import React from "react";
import data from "./data";
import Products from "./components/product";

export default function HomeScreen() {
  return (
    <div>
      <div className="row center">
        {data.products.map((item) => (
          <Products key={item._id} item={item} />
        ))}
      </div>
    </div>
  );
}
